import React from "react";
import "./ProductCard.css";

function ProductCard() {
  const type = "category";

  return (
    <div className="playerCard">
      <div className="badge">
        <div className="badgeWrapper">
          <div className="right">
            <p className="productName">
              {/* {type === "pinned"
                ? "Pinned"
                : type === "category"
                ? "category"
                : ""} */}
              Lebron James
            </p>
            {/* {type === "pinned" ? (
              <span className={stockCount}> 300 items in stock</span>
            ) : (
              ""
            )} */}
            <p className="position">Power forward</p>
          </div>
          <div className="left">
            {type === "pinned" ? (
              <img src="/bids.svg" alt="" className="boostIcon" />
            ) : // <p>left</p>
            type === "category" || type === "product" ? (
              // <img
              //   src="/icons/whiteChevron.svg"
              //   alt=""
              //   className="whiteChevron"
              // />
              <img src="/lakersLogo.svg" alt="" className="boostIcon" />
            ) : (
              ""
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProductCard;
